import React from 'react';

const Services = () => {
  return (
    <section id="services" className="services-section">
      <div className="container">
        <h2>Our Services</h2>
        <ul>
          <li>Office Cleaning</li>
          <li>School Cleaning</li>
          <li>Healthcare Facility Cleaning</li>
          {/* More services */}
        </ul>
      </div>
    </section>
  );
};

export default Services;
